INSERT INTO `items` (`id_item`, `title`, `body`, `image`, `vedio`, `id_category`) VALUES
(1, 'Manager Message', '<p>&lt;p&gt;this is the manager message in english&lt;/p&gt;</p>', NULL, '', 7),
(2, 'About EduHome', 'EduHome is an e-learning platform, it represents a strengthening in the Syrian curriculum system, this platform provides the best educational courses that are made by the best teachers of the Syrian Arab Republic.\r\nWhat you can through this platform:\r\nAs a student: You can register for the courses you choose and monitor your progresses.\r\nAs a teacher: You can share your professional skills in the development of new courses or to improve courses that already exists.\r\n', '', '', 1),
(3, 'Our mission', '<p>Our mission is to provide education to any student, anywhere, anytime.</p>', '', '', 3),
(4, 'Our vision', '<p>&lt;p&gt;Using e-learning so efficiently to achieve education justice&lt;/p&gt;</p>', '', '', 8),
(5, 'Our goals', 'زیادة فرص الالتحاق بالتعلیم الالكتروني و إتاحتها للجمیع وفق معاییر الجدارة\r\nتعزیز المواءمة بین مخرجات التعلیم و متطلبات سوق العمل\r\nتطویر الأداء و كفاءة الاستثمار الأمثل للخبرات\r\n', '', '', 1),
(6, 'Alaa Saadeidn', '<p>&lt;p&gt;member&lt;/p&gt;</p>', NULL, '', 5),
(7, 'Ola mahmalji', '<p>&lt;p&gt;admin&lt;/p&gt;</p>', NULL, '', 4),
(8, 'Rahaf jawish', '<p>member</p>', NULL, '', 5),
(9, 'Aya alsaadi', '<p>member</p>', NULL, '', 5),
(10, 'كلمة المدير', 'تعمل منصة شغف على تأمين فرص تعليمية للراغبين بها و تأمين الكوادر العلمية المؤهلة و المدرّبة، و هي بذلك تؤدي مهمة أساسية في عملية البناء و التطوير و التغيير التي تهدف إلى وضع سورية على خريطة الدول المتقدمة و القــــادرة على المنافسـة عالميـاً.\r\nشهد التعليم التعليم الالكتروني خلال العقد الماضي تطوراً كبيراً من خلال زيادة عدد المنصات المجانية المفتتحة تلبية لتزايد الطلب على التعليم, و قد أخذت شغف هذه الفرصة لتساهم في زيادة الفرص التعليمية لأبنائنا الطلبة، و بلغ عدد الطلاب في شغف ما يزيد عن 650 ألف طالباً و طالبة.\r\n و تعمل شغف على إحداث تطور نوعي في مجال التعليم الالكتروني و مخرجاته المعرفية و البحثية و إقامة نظم لضمان الجودة و الاعتماد، فقد أطلقت برنامجاً لصياغة و وضع مناهجاً الكترونية أكاديمية لجميع الاختصاصات.\r\n و كجزء من مسيرة النهوض بجودة التعليم و مواءمته لمتطلبات التنمية و سوق العمل تواصل شغف جهودها في تحديث الخطط الدراسية وتطويرها و إحداث تخصصات جديدة تتوافق مع التطوير الاقتصادي و الاجتماعي بما يلبي حاجات التنمية الشاملة و المستدامة.\r\n', NULL, NULL, 0),
(11, 'new_item', '<p>this is new item</p>', NULL, NULL, 3);

